import { Label, TextInput } from 'flowbite-react';
import React from 'react';

const StepThree = () => {
    return (
        <div className="mx-36 my-10">
            <div>
                <div className="mb-2 block">
                    <Label htmlFor="username" value="Tên người dùng" />
                </div>
                <TextInput id="username" required shadow type="text" />
            </div>
            <div className="grid grid-cols-2 gap-5 mt-3">
                <div>
                    <div className="mb-2 block">
                        <Label htmlFor="password" value="Mật khẩu" />
                    </div>
                    <TextInput id="password" required shadow type="password" />
                </div>
                <div>
                    <div className="mb-2 block">
                        <Label htmlFor="confirm" value="Xác nhận mật khẩu" />
                    </div>
                    <TextInput id="confirm" required shadow type="password" />
                </div>
            </div>
        </div >
    );
};

export default StepThree;
